        \           <incident:Description>SentinelOne has observed in-the-wild (ITW)
        exploitation of CVE-2023-34362, a vulnerability in the MOVEit file transfer
        server application. The attack delivers a Microsoft IIS .aspx payload that
        enables limited interaction between the affected web server and connected
        Azure blob storage. On June 5, the Cl0p ransomware group claimed responsibility
        for these attacks, though SentinelOne notes the targeting of a file transfer
        application vulnerability resembles other exploitation conducted by financially
        motivated actors throughout early 2023.</incident:Description>\n        </stix:Incident>\n
